function symbol() public view returns (string memory) {
    // Assuming `store_d` is a storage variable holding the symbol data
    uint256 symbolLength = uint256(store_d & 0xFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF);
    uint256 symbolOffset = 0x20 + (symbolLength + 0x1f) / 0x20 * 0x20;

    if (symbolLength == 0) {
        return "";
    }

    if (symbolLength > 0x1f) {
        bytes memory symbolData = new bytes(symbolLength);
        for (uint256 i = 0; i < symbolLength; i++) {
            symbolData[i] = bytes1(storage_map_b[symbolOffset + i]);
        }
        return string(symbolData);
    } else {
        bytes32 symbolRaw = storage_map_b[symbolOffset];
        return string(abi.encodePacked(symbolRaw));
    }
}
